import React from "react";
import LoginForm from "./LoginForm";
import SignUpForm from "./SignUpForm";
import TodoList from "./TodoList";
import AddTodo from "./AddTodo";
import "./MainPage.css";

const MainPage = () => {
  return (
    <div className="main-page-container">
      <header>
        <h1>Todo App</h1>
        <nav>
          <ul>
            <li>Logout</li>
          </ul>
        </nav>
      </header>
      <main>
        <SignUpForm />
        <LoginForm />
        <TodoList />
        <AddTodo />
      </main>
    </div>
  );
};

export default MainPage;
